// custom chartjs y axis labels high to low
function chartjsYLabels(value, index, values) {
  var label = '';
  switch (value) {
    case 0:
      label = 'Low';
      break;
    case 50:
      label = '';
      break;
    case 100:
      label = 'High';
      break;
    default:
      label = '';
  }
  return label;
}

