// randomly ask user for feedaback and display a link for a google form
// will open and modal form with a link to a google form https://forms.gle/21PPCSobQCGN7m157
function askForHelp() {
  var start = 0;
  var end = 5;
  var shouldIAsk = Math.floor(Math.random() * end + start);
  if (!shouldIAsk) {
    // is zero ask for help
    var componentElem = document.getElementById('askforhelp-holder');
    componentElem.innerHTML = _askforhelp2.default;
    $(function () {
      $('#askForHelpModal').modal('show');
    });
  }
}

